import React, { useState } from "react";

function Car({ information }) {
  const [renderDetail, setRenderDetail] = useState(false);
  return (
    <div className="w-full">
      <div>
        {renderDetail ? (
          <>
            <div>{information.id}</div>
            <div>{information.carName}</div>
            <div>{information.carPrice}</div>
          </>
        ) : (
          <></>
        )}
        <div
          className="hover:p-[15%] bg-gray-200 hover:duration-500 mx-5"
          onMouseOver={() => {
            setRenderDetail(true);
          }}
        >
          {information.images.map((item, index) => {
            return (
              <div key={index}>
                <img src={item[index]} alt={"*Maybe API problem*"} />
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Car;
